import React, { useState } from "react";

function Input() {
  const [infoInit, setInfoInit] = useState();
  const [infoFinal, setInfoFinal] = useState();

  const increment = (num) => {
    setInfoFinal(num + 1);
  };

  const decrement = (num) => {
    setInfoFinal(num - 1);
  };

  return (
    <>
      <h1>Test Information</h1>
      <input type="text" value={infoInit} onChange={() => setInfoInit}></input>
      <button onClick={() => increment(infoInit)} label="Increase"></button>
      <button onClick={() => decrement(infoInit)} label="Decrease"></button>
      <p>{infoFinal}</p>
    </>
  );
}

export default Input;
